import React from 'react';
import './Grid.css';

const Grid = () => {
  const renderCells = () => {
    let cells = [];
    for (let i = 0; i < 16; i++) {
      cells.push(<div key={i} className='cell' />);
    }
    return cells;
  };

  return <div className='grid'>{renderCells()}</div>;
};

export default Grid;
